use crate::atlas::Outline;
use crate::spline::{Rect, Spline};
use ttf_parser::OutlineBuilder;

pub fn parse(svg_src: &str) -> Outline {
    // Parse the SVG input.
    let opt = usvg::Options::default();
    let rtree = usvg::Tree::from_str(svg_src, &opt.to_ref()).unwrap();
    let svg = rtree.root();

    //
    // Transform the SVG to have height=1.
    //

    let bbox = rtree.svg_node().view_box.rect;
    let height = bbox.height() as f32;
    let scale = 1.0 / height;

    // Coordinate transforms.
    let tx = |x: f64| scale * (x - bbox.x()) as f32;
    let ty = |y: f64| scale * (y - bbox.y()) as f32;

    // Bounding box of the SVG with the origin on the bottom left.
    let bbox = Rect {
        x0: 0.0,
        y0: 0.0,
        x1: tx(bbox.x() + bbox.width()),
        y1: 1.0,
    };

    //
    // Construct BÃ©zier splines of the paths contained in the SVG.
    //

    let mut spline_builder = Spline::builder();

    for child in svg.children() {
        // Find all the paths in the SVG.
        if let usvg::NodeKind::Path(usvg::Path { data, .. }) = &*child.borrow() {
            // Trace the path in the spline builder.
            for instruction in data.iter() {
                match instruction {
                    usvg::PathSegment::MoveTo { x, y } => {
                        spline_builder.move_to(tx(*x), 1.0 - ty(*y))
                    }
                    usvg::PathSegment::LineTo { x, y } => {
                        spline_builder.line_to(tx(*x), 1.0 - ty(*y));
                    }
                    usvg::PathSegment::CurveTo {
                        x1,
                        y1,
                        x2,
                        y2,
                        x,
                        y,
                    } => {
                        spline_builder.curve_to(
                            tx(*x1),
                            1.0 - ty(*y1),
                            tx(*x2),
                            1.0 - ty(*y2),
                            tx(*x),
                            1.0 - ty(*y),
                        );
                    }
                    usvg::PathSegment::ClosePath => {
                        spline_builder.close();
                    }
                }
            }
        }
    }

    let spline = spline_builder.build();
    let mut verts: Vec<(f32, f32)> = Vec::with_capacity(100);
    for bez in spline.strokes() {
        verts.push(bez.0.into());
        verts.push(bez.1.into());
        verts.push(bez.2.into());
    }

    Outline {
        ctrl_pts: verts,
        bbox,
    }
}

